import React from "react";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";

function TrafficCam() {
	return (
		<div>
			<Box>
				<Typography variant="h1" display="flex-end">
					Traffic Camera
				</Typography>
			</Box>
		</div>
	);
}

export default TrafficCam;
